import React, { Fragment } from 'react';
import styled from 'styled-components';

const Container = styled.div`
	text-align: center;
	padding-top: 44px;
`;

const MusicChoiceLogo = styled.img`
	margin-top: 20px;
`;

const Heading = styled.h1`
	color: #00aaf4;
	font-size: 105px;
	line-height: 105px;
	margin: 40px 0 35px 0;
	font-weight: bold;
	font-family: cera_probold, Arial, Helvetica, sans-serif;
`;

const MainCopy = styled.p`
	color: #455051;
	font-size: 37px;
	line-height: 37px;
	max-width: 990px;
	margin: auto;
	font-weight: bold;
	font-family: cera_prolight, Arial, Helvetica, sans-serif;
`;

const MusicButtonsRow = styled.div`
	margin-top: 60px;
	margin-bottom: 50px;
	flex-flow: row nowrap;
`;

const Footnote = styled.p`
	color: #455051;
	font-size: 18px;
	font-family: cera_prolight, Arial, Helvetica, sans-serif;
	margin: 60px 20px 10px 20px;
	text-align: left;
`;

const listen = (props) => (
	<Fragment>
		<Container>
			<MusicChoiceLogo src="assets/images/music-choice.png" alt="music choice" />
			<Heading>
				Hear the difference!
			</Heading>
			<MainCopy>
				Use the buttons below to select a genre and discover just how great your music can sound.
			</MainCopy>
			<MusicButtonsRow>
				<AudioButton text="Rock" musicSrc="assets/audio/test.mp3" />
				<AudioButton text="Jazz" musicSrc="assets/audio/test.mp3" />
				<AudioButton text="Country" musicSrc="assets/audio/test.mp3" />
				<AudioButton text="Hip Hop" musicSrc="assets/audio/test.mp3" />
			</MusicButtonsRow>
			<img src="assets/images/volume.png" alt="volume" />
			<Footnote>Music provided by Music Choice, <br />available now on Contour.</Footnote>
		</Container>
	</Fragment>
)

export default listen;
